import React from "react";

import Task from "../Components/Task";

const TaskList = ({array}) => {
    return (
        <ul className="todo-list">
            {array.map(el => {
                return <Task
                    title={el.title}
                    time={el.time}
                />
            })}
        </ul>
    );
};
export default TaskList;
